class Solution:
    def findLength(self, A, B):
        """
        :type A: List[int]
        :type B: List[int]
        :rtype: int
        """
        dp = [[0 for _ in range(len(B))] for __ in range(len(A))]
        res = 0
        for i in range(len(A)):
            for j in range(len(B)):
                if A[i] == B[j]:
                    dp[i][j] = 1 if i==0 or j == 0 else dp[i-1][j-1]+1
                res = dp[i][j] if dp[i][j]>res else res
        return res

